	protected void initLogger() throws Exception {
		Handler handler;
		handler = new FileHandler(prop.getProperty("logFileName", "ACSLoger.txt").trim(), true);
		theLogger.addHandler(handler);
		theLogger.setLevel(Level.ALL);
		handler.setFormatter(new Formatter() {
			@Override
			public String format(LogRecord record) {
				// TODO Auto-generated method stub
				String res;
				long milis= record.getMillis();
				res=AsUtilities.getTimeMili(milis)+"\t";
				res+=record.getLevel()+"\t";
				res+=record.getMessage();
				return res;
			}
		});		
	}
	protected void initGraphStore() {
		graphStore= new GraphStore(prop);
		int inter=prop.getInteger("interval",1000);
		graphStore.setInterval(inter);
		Runnable runnable = graphStore;
		Thread thread = new Thread(runnable);
		thread.start();		
	}
	protected String paramInfo() {
		String res=prop.getWord("serialname", "XX");
		res+="\tnAnts "+prop.getInteger("nAnts", -1);
		res+="\tnIter "+prop.getInteger("nIterations", -1);
		res+="\t#Cls "+prop.getInteger("mustBeClients", -1);
		res+="\tnRuns "+prop.getInteger("nRuns", -1);
		res+="\tCmd "+prop.getWord("defCommand", "XX");
		res+="\tnCPool  "+prop.getInteger("CargoPoolSize", -1);
		res+="\tCRand "+prop.getBoolean("CargoRandomMode", false);
		res+="\tpropFer "+ prop.getBoolean("propagateFeromons", false); 
		return(res);
	}
	public AntCommunityServer(String fn) throws Exception {
		FileReader fr= new FileReader(fn);
		prop.load(fr);
//		if (!isOK()) {
//			System.err.print("Parameters not accepted, end of run\n");
//			System.exit(2);
//		}
		fr.close();
		initLogger();
		long d= (new Date()).getTime();
		theLogger.severe("...\t\n");
		String msg="<========NEW=======> ACS v. " +versionNo +"\t"+AsUtilities.getDate(d)+"\t"+AsUtilities.getTime()+"\n";
		theLogger.severe(msg);
		theLogger.severe(paramInfo()+"\n");
		propagateFeromons=prop.getBoolean("propagateFeromons", false);
		initGraphStore();
		initServer();
		initCargoPool();
	}
	protected void initCargoPool() {
		int size=prop.getInteger("CargoPoolSize", 1);
		if (size<0) {
			thePool= new CargoPool();
		} else {
			boolean randMode= prop.getBoolean("CargoRandomMode", false);
			thePool = new CargoPool(size, randMode);
		}
		AntCommunityCargo acc= new AntCommunityCargo(prop);
		thePool.storeCargo(acc);
	}
	protected boolean isOK() {
		boolean res=true;
		Scanner sc=new Scanner(System.in);
		System.out.println("Run parametrs:\n"+paramInfo()+"\nIs it OK?");
		String resp=sc.nextLine();
		res=resp.toLowerCase().startsWith("ok")|| resp.toLowerCase().startsWith("y")||
				resp.toLowerCase().startsWith("t") || resp.toLowerCase().startsWith("1");
		sc.close();
		return(res);
	}
	protected AntServerCommand getCommand() {
		if (currClientNo<prop.getInteger("mustBeClients", 1)) {
			return(AntServerCommand.SLEEP);
		}
		int maxRunNo=prop.getInteger("nRuns", 1);
		if (maxRunNo>0 && maxRunNo<currRunNo) {
			return(AntServerCommand.STOP);
		}
		String s= prop.getWord("defCommand", "sleep");
		return(AntServerCommand.toCommand(s));
	}
	public void initServer() throws IOException {
		int hostPort= prop.getInteger("HostPort", 8981);
		sock = new ServerSocket(hostPort);
		theLogger.severe("Ant Server is ready for connections\n");		
	}

	public void runServer() throws Exception
	{
		int nRuns;
		while(currRunNo<(nRuns=prop.getInteger("nRuns", 5))) {
			try {
				/* Wait for a connection */
				sock.setSoTimeout(1000+nRuns);
				clientSocket = sock.accept();
				new ObjectHandler(clientSocket).start();
			}
			catch (SocketTimeoutException ex) {
				// try once more
			} catch(IOException e) {
				/* Crash the server if IO fails. Something bad has happened */
				theLogger.severe("Could not accept " + e+"\n");
				System.exit(1);
			}
		}
		long duration=System.currentTimeMillis()-clientStarted;
		double power=prop.getPowerMerics(clientStarted);
		theLogger.severe("Ant Community Server duaration=>\t"+
				AsUtilities.integer2String(duration)+
				"\tmilisecends, load:\t"+
				AsUtilities.double2String(prop.getComputationLoad())+"\t[ "+ 
				AsUtilities.double2String(power,3)+
				" ]\tEND OF WORK  ================\n");
		return;
	}


	public void showParams() {
		System.out.print(prop.toString());
	}

